Nilfisk UZ 964 støvsuger gir en 160 W høy suge på munnstykket.

Til Nilfisk UZ 964 støvsuger, er det et bredt utvalg av valgfritt tilbehør.

Om Nilfisk UZ 964, er det verdt å merke seg disse fakta:
- Quiet
- Maskinen veier bare 2,9 kg
- 15 m kabel
- Ideell for trapper, overfylte områder og høyde rengjøring

