  <Description><![CDATA[UDGÅET VARE!
Centralstøvsuger - en miljø- og brugervenlig løsning
Centralstøvsugere er den perfekte løsning til støvugning af hjemmet med lavt støjniveau, et renere resultat og et minimum af besvær. Sæt blot den 9 meter lange slange ind i den nærmeste sugekontakt, og støvsugeren starter. Den eneste lyd, der høres, er støvsugerens hvisken i sugekontakten.
Centralstøvsugeren er let at installere i både eksisterende huse og nybyggede boliger. Systemet er meget brugervenligt og resulterer i et renere hjem end nogensinde før. Med centralstøvsugeren følger alle de nødvendige samlinger til et Ø50 mm rørsystem, der fås i to forskellige størrelser afhængigt af husets størrelse. Installationskit 2 indeholder alle nødvendige materialer til installation af to sugekontakter til mindre og middelstore hjem, mens installationskit 3 indeholder materialer til tre sugekontakter.


Produktfakta:

-Selve <a href="http://www.billigkoste.dk/Shop/list.htm?catid=177">støvsugeren</a> er placeret afsides og ude af syne, men altid
 klar til brug
-Meget lavt støjniveau, du hører kun støvsugerens hvisken i
 sugekontakten
-Automatisk tænd/sluk, støvsugeren starter, så snart sugeslangen
 sættes i sugekontakten
-Udblæsningsluften føres ud af huset, klimaet indenfor er rent og
 støjfrit
Installationen foretages hurtigt og let v.h.a. et installationskit
CENTIX 60 og 60 PREMIUM kan hurtigt og nemt tages ned fra vægbeslaget og anvendes til mobilt brug.

Ink. standardtilbehør:
-Børste mundstykke Ø36
-Filterelement
-Filterpose
-Fugemundstykke, plast Ø36
-Kombimundstykke, plast
-Polstermundstykke m/børst
-Sugeslange 9 m.Ø32 Centix

LYDEFFEKT NIVEAU IEC 704 DB(A) - 59

HVILKEN STØVSUGER SKAL JEG VÆLGE?
Det er til at starte med vigtigt, at finde ud af, hvor støvsugeren skal anvendes! 

Hvis støvsugeren skal bruges i et privat hjem, har vi den del af Nilfisks sortiment af husholdningsstøvsugere, som vi kan stå 100 procent inde for. Derudover har vi hele sortimentet af centralstøvsugere fra Nilfisk og Alto.

Skal du bruge din støvsuger til professionel brug dvs. hvis du har et rengøringsfirma eller gør professionelt rent i kontormiljøer, på skoler eller institutioner, skal du vælge en støvsuger fra Nilfisk kommercielle støvsuger serie, som hos os står under professionelle støvsugere. Det er dog også muligt, at bruge en af vores Nilfisk rygstøvsuger til ovennævnte miljøer for, at opnå en mere ergonomisk korrekt arbejdsstilling.

Skal din støvsuger derimod bruges til produktionsvirksomheder, serviceværksteder, lager, håndværksopgaver, vandsugning fra oversvømmede eller fugtige kældre mv., skal du benytte en støvsuger fra vores kategori industrielle støvsugere.]]></Description>
</product><product>
