  <Description><![CDATA[Vi er udsatte for luftbårne partikler overalt i vores hjem, fordi alt producerer støv: den menneskelige hud, bøger, røg, gardiner, kæledyr, elektriske apparater o.s.v., plus det støv, vi slæber ind udefra. Vi har vores egne beskyttende filtre i næse, lunger og bronkier, som forhindrer os i at indånde for meget støv, og vi har den uundværlige støvsuger til at hjælpe os.

 Alle støvsugere udleder udstødningsluft, som sendes gennem et filter, før det sendes tilbage i rummet som ren luft. Men filtre er ikke bare filtre, og nogle partikler er så små, at de går lige igennem et mindre effektivt filter og sendes tilbage til rummet. Vi fornemmer det måske ikke - nogle mennesker er mindre følsomme end andre, men støvet er der og det er bestemt ikke sundt. Når man ser på de gener det kan give, såsom astma, allergi og bronkitis, som er stigende sundhedsproblemer, giver det god mening at vælge HEPA-filtre. Nilfisk vælger dem.

 HEPA er en forkortelse for High Efficiency Particulate Air. Det er et anerkendt filtersystem, der tilbyder fem filtrerings klasser fra HEPA 10 til 14. Kategori 13 og 14 er i stand til at opfange de mikroskopiske partikler fra tobaksrøg og husstøvmideafføring - som er de udløsende faktorer for støvallergi - og filtrene sender den rensede luft tilbage til rummet endnu renere end før.

Et HEPA-filter skal skiftes ca. en gang om året.]]></Description>
</product><product>
