  <Description><![CDATA[<h2>Denne model er desværre udgået. Vi anbefaler den nye serie AERO istedet</h2>

Støv-/vådsugere til den private og semi-professionelle bruger

Aero støv-/vådsugerne er udstyret med det manuelle Push&Clean filterrensesystem. Letvægtsstøvsugere, der er nem at transportere fra sted til sted. Plastbeholder og kapacitet på 20L. Modellen  har aut. start/stop af el-værktøj.

Med den nye Aero støv-/vådsuger får du høj ydeevne i et kompakt design, høj kapacitet og lavt støjniveau. Alle modeller i serien er velegnet til at suge vådt eller tørt snavs i eller omkring dit hus, værksted eller anden hobby-brug.

Modellen er udstyret med stik til el-værktøj, og  har desuden automatisk tænd/sluk af el-værktøj, hvorved støvsugeren styres gennem el-værktøjet. 

Det nye Fleece filterpose-system giver mulighed for opsug af fugtigt snavs uden at ødelægge filterposen. Med en kraftig 1300 watt motor, og høj luftmængde, er de nye Aero-modeller ideelle til sug af stort set alt slags snavs. Støvsugerne er udstyret med dørtrinsglider til stabil kørsel over dørtærkskler. Aero-modellerne er udstyret med en række nyttigt tilbehør, så du kan starte med det samme.

Manuelt Push&Clean filterrensesystem: Filteret renses på få sekunder, du undgår at det stopper til og en konstant høj ydeevne opnås

- Motor på 1300 watt: Mulighed for opsug af selv tungt snavs
- Dørtrinsglider til stabil kørsel over dørtærskler
- Kraftige snaplåse
- Tilbagetrukne hjul, der ikke hænger fast i møbler el.lign.
- To drejehjul og to kørehjul: Høj stabilitet og mobilitet
- Fleece filterposesystem: Mulighed for opsug at fugtigt snavs
- Vådfilter beskytter motor: Længere levetid
- Smart kliksystem: Hurtig skift mellem tilbehør

