  <Description><![CDATA[Rondel Twister 19" 480 mm. 2 stk

Rød eller sort

Twister rondeller er et revolutionerende rengøringssystem bestående af vaskerondeller, der er imprægneret med milliarder af mikroskopiske diamanter. Rondellerne renser og polerer gulvet mekanisk, uden brug af rengøringsmidler. 

Twister kan anvendes på de fleste almindelige gulve, som eksempelvis terrazzo-, sten-, beton-, vinyl- og epoxygulve. Twister forvandler kedelige, matte og slidte gulve til rene, skinnende og højglanspolerede gulve. 

RØD:
Til Industrielle epoxygulve -og maskinpolerede betongulve.
Til grundig rengøring af slidte gulve, herunder stengulve.
Twister? rød fjerner effektivt ridser og pletter fra gulvet og efterlader overfladen ren, mat og klar til næste trin i Twister? systemet.
 
SORT:
Til rå, ubehandlede betongulve.
Til grundig rengøring af plettede og snavsede industrigulve og rå betongulve. 
Fjerner olie, fedt, sod og dækmærker. 
Twister? sort er industriens problemknuser.]]></Description>
