  <ImageURL>http://www.kashop.no/files/images/pic/gd930-c.jpg</ImageURL>
  <Description><![CDATA[Legg merke til at denne støvsugeren modellen er IKKE HEPA filter.
Denne modellen leveres med ORANSJE ledningen.
Nilfisk GD 930 er valgt som verdens beste støvsugeren av hele rengjøring industrien.

Kraftig og kostnadseffektiv Nilfisk støvsuger.

<div align="center"><a href="#TB_inline?height=555&width=925&inlineId=myOnPageContentGD930" title="Modeloversigt for Nilfisk GD 930 modellerne" class="thickbox"><img src="/files/images/jacob/knap-rigtigt.png" border="0" /></a>
<div id="myOnPageContentGD930" style="display: none;">
<p><iframe src="/gd930.htm" width="100%" height="520" frameborder="0" scrolling="no" allowtransparency="true"></iframe></p>
</div></div>

Denne støvsugeren brukes av millioner av selskaper og institusjoner over hele verden, så her er en populær effektiv støvsuger.

Denne støvsugeren modellen er IKKE HEPA filter, og den henholdsvis kun har en sugekraft og en hastighet.

Er kravene til ulike valg enkle, denne støvsugeren lett match de større støvsugermodeller fra Nilfisk hvor sammenligningen kommer til pålitelighet, drift og sugekraft.

Det er en kompakt og smart støvsuger av høy klasse og kvalitet, og er ideell for daglig rengjøring av store områder. Legg merke til at ingen steder kreves bruk av HEPA-filter.

Den har en solid konstruksjon og enkel betjening. Den har en 15 liter stor støvpose og 15 meter kabel som gir en stor arbeidsradius. Støvsugeren gir valuta for pengene, og er et godt valg for rengjøring som hoteller, skoler, kontorer og sykehus, med høy krav til rensing av høy kvalitet.

Spesifikke produkt fakta for Nilfisk GD 930 S er en enhet som har en stor filterområdet, det er stille med et lavt støynivå, har en hastighet, så det er svært enkelt å betjene.


