  <Description><![CDATA[Alto TW300 <a href="/pl/Tepperenser">Tepperenser</a> for profesjonell bruk.

TW 300 er svært fleksible teppe rengjøringsmidler. TW 300 er en profesjonell renere for rengjøring av store områder, på busser, fly, etc. Perfekt for rengjøring selv de mest skitne tepper.
Merk at når du rengjør møbler må kjøpes separat møbeltrekk!

Tekniske spesifikasjoner:
Pumpetrykk: 2 bar
Rent-/snavsvandstank: 8 L / 8 L
Vekt: 9,5
EL kabellengde: 7,5 M
Inngangseffekt: 1000 W

Nilfisk-ALTO TW 300 kan rengjøring både teppe, støvsuging og vådsuge. For de som ønsker å holde dine eiendeler intakt. Unngå å måtte erstatte tepper eller re-polstre møbler. Et bredt utvalg av tilbehør inkludert.

Standard tilbehør:
- Sugeslangen m.kobl, TW 300
- Teppemunnstykke f TW med en dyse, plastrør, 260 mm.
- M.indvendig møbelmunnstykke 80 mm.
Produktfakta:
