  <Description><![CDATA[Rondel Twister 19", 480 mm, 2 stk

Gul

Twister rondeller er et revolutionerende rengøringssystem bestående af vaskerondeller, der er imprægneret med milliarder af mikroskopiske diamanter. Rondellerne renser og polerer gulvet mekanisk, uden brug af rengøringsmidler. 

Twister kan anvendes på de fleste almindelige gulve, som eksempelvis terrazzo-, sten-, beton-, vinyl- og epoxygulve. Twister forvandler kedelige, matte og slidte gulve til rene, skinnende og højglanspolerede gulve. 


Twister?-rondellerne kan anvendes ved hastigheder på op til 3.500 omdr./min. Ved højhastighedspolering af bløde gulve som eksempelvis vinyl bør man dog altid følge fabrikantens anbefalinger angående højest tillade poleringshastighed. 

HVID OG GUL: 
Twister? Hvid og Twister? Gul renser i dybden og fjerner effektivt mindre ridser. Samtidig poleres gulvoverfladen, så gulvet går fra at være snavset, mat og kedeligt til at være rent, skinnende og glansfuldt. Og denne dybderensning sker helt uden brug af rengøringsmidler.
 
Ved dybderensning eller polering af et stengulv eller et terrazzo gulv, anbefales det dog, at man anvender en mild gulvsæbe, som eksempelvis et rengøringsmiddel med tilsat plejemiddel fra Nilfisk, for at undgå udtørring af gulvet. Ved alle andre gulvtyper kan man nøjes med at bruge vand til dybderensning og polering.
 
Dybderensning og polering er en indledende engangsbehandling, der som oftest ikke behøver at blive gentaget, hvis gulvet rengøres dagligt med den grønne Twister?-rondel.]]></Description>
</product><product>
