  <Description><![CDATA[Nilfisk Roof Cleaner er den første gør-det-selv-løsning nogensinde, der er specielt udviklet til tagrengøring. Roof Cleaner, der er et tilbehør til hobby <a href="http://www.kashop.no/pl/hoeytrykksvaskere">højtrykksvaskere</a>, har en teleskop-stang, der kan blive helt op til 4,2 meter. 

Passer til modellerne:
Compact serien, Excellent serien og Pro serien fra Alto.
Passer til alle modeller med Quick Coupling system! (Du skal kunne klikke slangen af pistolen)
Bemærk at modeller ÆLDRE end fra 2007 måske ikke passer -skriv hvilken model den skal passe til når du bestiller, så for du automatisk besked hvis den ikke passer!

Desuden har den en skumdyse med en koncentreret stråle, der kan sprøjte helt op i 11 meters højde, og det giver en samlet rækkevidde på op til 15 meter. 
Nilfisk Alto har også udviklet et specielt Roof Cleaner rengøringsmiddel, der anbefales til brug sammen med den nye Roof Cleaner. 

Nilfisk Roof Cleaner er velegnet til de fleste villatage, og fordelen ved konceptet er, at man får adgang til hele taget uden at behøve at klatre op på det. Det er en gør-det-selv-tagrenser, hvilket betyder, at husejeren selv kan udføre arbejdet uden at behøve at hyre en professionel tagspecialist. Dysen har en koncentreret stråle, der under lavtryk udlægger en skumfilm på taget, der med hjælp fra vejr og vind opløser snavs og andre belæg- ninger. Dysen kan justeres i forskellige vinkler på op til 45 grader, så man kan nå helt ind i alle tagets hjørner og kroge

