NEPTUNE 4 FA er en optimal løsning for middels tunge rengjøringsjobber. NEPTUNE 4 FA representerer et helt nytt nivå av pålitelighet og komfort med sitt utseende og flyte overvåkingssystem der vann bevegelse gjennom flyt sensor sender start-/stopimpulser til motoren og kjeler.

Neptune 4 FA - serien består av et antall med varmt vann teknologi og ytelse
brukervennlighet, lavt støynivå og høy rengjøringseffekt. Kostnaden for drift og vedlikehold er redusert til et minimum.
Den nye flyt overvåkingssystem ( FA ) gjør produktet enda mer brukervennlig, og gir både lang levetid, god pålitelighet og redusere driftskostnadene.
EcoPower kjele systemet fører til økt effektivitet på> 92 % på grunn av en betydelig reduksjon i drivstofforbruk, svært lave driftskostnader og redusert luftforurensning.
Stille Effekt 1450 rpm motor betydelig reduksjon i støy og øker pumpens levetid.
Hurtig service : Vedlikeholdskostnadene er minimert og servicetiden reduseres med opptil 25%.
Ergo Systemtilbehør for ekstra bekvemmelighet.

