  <Description><![CDATA[Nilfisk VP300 HEPA er ideell for daglig rengjøring av lys til medium rengjøringsoppgaver som kontorer, hotellrom, butikker, etc.

Det unike med VP300 HEPA er den sterke filtrering kombinert med effektiviteten i motoren på 1200 W. HEPA filter sørger for bedre luftkvalitet i rense miljøet og den kraftige motoren sikrer en eksepsjonell og effektiv rengjøring.

VP300 HEPA er enkel å bruke, har innebygde spor for tilbehør, kabeloppbevaring og parkeringsløsning til røret. I tillegg er det ergonomiske håndtaket gjør det mulig for brukeren å bære hele støvsugeren i en hånd.

Med et lydnivå på bare 50 dB ( A), dette vakuumet egnet for dagtid rengjøring av kontorer, resepsjoner, sykehus og andre støyfølsommeområder.

- Sertifisert HEPA filter

- Oransje avtakbar ledning øker sikkerheten og forenkler vedlikehold

- Maksimal netto kapasitet i sin klasse, noe som betyr mindre tid til å tømme støvposer

- Veier bare 5,3 kg og er lett å flytte fra sted til sted

- Lavt lydnivå på bare 50 dB ( A) gjør den renere egnet til rengjøring på dagtid

- Sikker lagring av tilbehør og strømledningen, og parkeringsløsning for rør

