Aero støv-/vådsugerne er udstyret med det manuelle Push&Clean filterrensesystem. Letvægtsstøvsugere, der er nem at transportere fra sted til sted. Plastbeholder og kapacitet på 20L. 

Med den nye Aero støv-/vådsuger får du høj ydeevne i et kompakt design, høj kapacitet og lavt støjniveau. Alle modeller i serien er velegnet til at suge vådt eller tørt snavs i eller omkring dit hus, værksted eller anden hobby-brug. 

