Det nye Fleece filterpose-system giver mulighed for opsug af fugtigt snavs uden at ødelægge filterposen. Med en kraftig 1400 watt motor, og høj luftmængde, er de nye Aero-modeller ideelle til sug af stort set alt slags snavs. Støvsugerne er udstyret med dørtrinsglider til stabil kørsel over dørtærkskler. Aero-modellerne er udstyret med en række nyttigt tilbehør, så du kan starte med det samme.

Manuelt Push&Clean filterrensesystem: Filteret renses på få sekunder, du undgår at det stopper til og en konstant høj ydeevne opnås

- Motor på 1400 watt: Mulighed for opsug af selv tungt snavs
- Dørtrinsglider til stabil kørsel over dørtærskler
- Kraftige snaplåse
- Tilbagetrukne hjul, der ikke hænger fast i møbler el.lign.
- To drejehjul og to kørehjul: Høj stabilitet og mobilitet
- Fleece filterposesystem: Mulighed for opsug at fugtigt snavs
- Vådfilter beskytter motor: Længere levetid
- Tilbehørsholder
- Smart kliksystem: Hurtig skift mellem tilbehør

