  <Description><![CDATA[3-fase industriell støvsuger med kraftig sidekanalvifte

ATTIX 155-01 er en mobil våd-/tørsuger med sidekanalvifte og 100-liters spann. Laget av rustfritt stål og derfor robust og pålitelig løsning for tyngre oppgaver innen mekaniske, keramisk og kjemisk industri, samt i næringsmiddelindustrien.

Doble sidekanalvifte rolig og pålitelig sikrer at ATTIX 155 kan jobbe i flere timer på rad uten service. Viften lave rangeringen gir en god vektfordeling som gjør maskinen manøvrerbare og dermed lett å flytte rundt - uavhengig av gulvflaten.

ATTIX 155 kan brukes til en rekke oppgaver - fra enkle, daglig rengjøring av produksjonsområde for innsamling av flytende avfall avfall og. En stor luftstrøm for optimal sugeevne og effektiv fjerning av tunge elementer, selv når du bruker store slangedimensjoner.

ATTIX 155 er utstyrt med en motor på h.h.v. 2200 W og 4000 V. sidekanalvifte er koblet i parallell til ATTIX 155, som sikrer meget høy luftstrøm - en perfekt løsning for oppsamling av store mengder støv.

Innebygd trykkmåleren viser brukeren når luftstrømmen faller og dermed når filteret skal rystes.

Fakta:
- 2,2 eller 4 kW dual sidekanalvifte
- Egnet for å samle støv, store gjenstander og væsker
- Stor stjerne filter og filterrister sikrer optimal filtrering
- Robust trigger system til den flyttbare 100 liters tank med hjul
- L klasse filter (M / W klasse filter eller HEPA filter er tilgjengelig som tilleggsutstyr)
- Automatisk væske for å stoppe kombinert med fuktig (valgfritt)
- Støtter for kabel, slange, rør og adapter for MultiFit tilbehørssystem
- Praktisk verktøy brett
- Stort utvalg av tilbehør for optimal fleksibilitet (leveres uten tilbehør)
 
