  <Description><![CDATA[P 150 tilhører Pro-serien, som er toppen av vår hobby renere program. Ergonomi og komfort i en kraftfull design og god ytelse gjør Pro er egnet for alle store rengjøringsoppgaver rundt huset og hagen - hest trailer, båt, svømmebasseng - så vel som for semi-profesjonell bruk.

For ekstra styrke og holdbarhet, P 150.2 utstyrt med stålforsterket Superflex høytrykksslange, sylinder i messing og metall pumpe. Ved P 150 andre supre mulighetene inkluderer trykkontroll, slangetrommel med intern tilkobling til pumpen, og integrerte holdere for dyser og annet tilbehør. Sist men ikke minst, store (40 x 200 mm) hjul og en solid aluminium teleskop kjørehåndtak sikrer høy mobilitet, enkel transport og enkel lagring. Rengjøring Høyden på å sikre god ergonomi. Den kjente bajonettkopling fra Nilfisk sikrer kompatibilitet med et bredt spekter av hobby renere tilbehør. Vaskemaskinen er utstyrt som standard med en pålitelig og robust induksjonsmotor med lang levetid. P 150.2 kan henges på egen vegg - eller brukes direkte fra veggfestet som en stasjonær enhet. X-TRA-modellen: Hose Reel leveres som standardutstyr.

Oppreist ergonomisk design
