  <Description><![CDATA[Multi til støvsuging både innendørs og utendørs.

Egnet for hjem, bil, verksted og hobby folk som ønsker en støvsuger til å suge opp vann, løv og andre grovere skitt. Det er en våd-/tørsuger, der er det ingen kompromisser på ytelse og brukervennlighet.

<div align="center"><a href="#TB_inline?height=525&width=925&inlineId=myOnPageContentMulti-20" title="Oversigt for Nilfisk-ALTO Multi 20 modellerne" class="thickbox"><img src="/files/images/jacob/knap-rigtigt.png" border="0" /></a>
<div id="myOnPageContentMulti-20" style="display: none;">
<p><iframe src="/multi-20.htm" width="100%" height="850" frameborder="0" scrolling="no" allowtransparency="true"></iframe></p>
</div></div>


Det er nå ikke nødvendig å bruke en halv dag til å blåse din jolle opp - nå tar det bare ca 20 sekunder - takket være den automatiske blåse -funksjonen på Multi . Og hvis det skulle skje at du trenger å suge opp vann fra kjelleren , så gjør denne støvsugeren også - bruke samme filter for både våt og tørr skitt .

Den eksklusive semi automatisk filterrensesystemPush & Clean Nilfisk funnet på alle Multi støvsugerne - du trenger bare å trykke på en knapp og filteret er renset i løpet av sekunder . Hurtig Park funksjonen betyr at du raskt og enkelt kan plassere og lagre forlengelsesrør i en unik og spesiell design holder maskinen .

- Semi Automatisk Push & Clean filterrengjøringssystem
- 1400 W motor og blåser
- 20 liters spann
- Automatisk kabelhåndteringssystemet ( CR -modellen )
- To svingbare hjul og to hjul
- Vaskbart PET fleece filterelementet
- Hurtig Park klikksystem for rask parkering forlengelsesrør med munnstykke
- Holdere for tilbehør, kabel og slange
- 1 stk . fleece filterpose inkludert
 
-KABEL LENGDE ( M ) 5
-POWER PMAX ( W ) 1400
-SPENNING / FASE / FREKVENS ( V / ~ / HZ ) 220-240/50-60
-FLOW ( L / min . ) 4000
-VAKUUM ( MBAR / KPA ) 210
-LYD (dB ( A) ) 65
-CONTAINER VOLUME ( L ) 20
-SLANGE LENGDE ( M ) 2
-DIMENSJONER L x B x H ( mm ) 390x370x530
-VEKT ( KG ) 6.7

<iframe width="500" height="284" src="http://www.youtube.com/embed/TrPNGO83pEw?rel=0" frameborder="0" allowfullscreen></iframe>]]></Description>
</product><product>
