Støvsuger pose bør kun endres omtrent en gang i året, og noen modeller ikke engang krever en støvsuger pose. Den lukkede rørsystem sikrer at selv de minste støvpartikler. Støvet suges gjennom rørene til en container plassert i garasjen, kjelleren eller loftet. Eksos luft blåses helt ut av huset. Hvis du har barn, dyr og / eller allergen i huset, er dette løsningen for et renere hjem og et sunnere innemiljø.

Diamond-serien representerer det ypperste av sentrale støvsugere. Modellene er utstyrt med en integrert lyddemper.

Alle Diamond modeller er IP55 godkjent, slik at de kan takle direkte vann.

Modellene er også tilgjengelig som full pakke (alt-i-2 Platinum) med alle deler for montering.

Anbefalte evner:
- Diamond 30 egnet for boliger opp til ca. 300 kvm.
- Diamond 40 egnet for boliger opp til ca. 400 kvm.
- Diamond 40 C kamp hus opp til ca. 500 kvm.

