Tilbageløbsventil inkl. han- og hun-koblinger. BA-ventilen følger den internationale standard EN 1717, der fastlægger at højtryksrensere kun må tilsluttes den almindelige drikkevandsforsyning, hvis de er forsynet med en reglementeret tilbageløbsventil. BA-ventilen forhindrer vandet fra renseren i at løbe tilbage i drikkevandsforsyningen. 
Dvs.
Tilbagestrømningssikring er en sikring der sørger for at tilgangsvandet ikke slår tilbage til drikkevandet.

Hvis man eksempelvis står og højtryksrenser med kemidunk på lansen, så kan man risikere at vand og kemi kan løbe tilbage i drikkevandsforsyningen.

Problemet kan opstå hvis og når man slipper pistolgreb. Dder opstår herved et tilbageslag igennem tilgangsslangen. Dette tilbageslag bremses i tilbagestrømningssikringen.]]></Description>
