Maskinen har et svært lavt støynivå gjør rengjøring på dagtid hvor som helst, selv i støyfølsomme områder. Gulvene er vasket og tørket i en operasjon, og den kompakte designen gjør at du kan få rett til kanten, selv i trange områder.

