  <Description><![CDATA[Industriell sikkerhet rangert våd-/tørsuger

ATTIX 965-0H / M SD XC har helautomatisk Xtreme Clean filterrengjøringssystem, to motorer og håndterer støv i både støvklasse H & M. Med rustfritt sitdown tank kan tømme tanken uten å fjerne motoren toppen - den perfekte utslipp system for industriell og farlig og kreftfremkallende støv.

Ved å velge riktig container tilnærmingen gjør det renere du holder skitt i et støvfritt og trygg løsning. Det korrosjons-og rustfri ståltank for lang levetid. Den oppsamlingspose (M-klasse) og sikkerhetsfilterpose, som begge er tatt med som standard, noe som sikrer støvfri vakuum.
  
- Godkjent for farlig støv klasse H & M
- To motorer, industriell styrke
- Helautomatisk Xtreme Clean filterrengjøringssystem
- Sitdown container
- 50 liters rustfritt kar
- Collection bag og sikkerhetsfilterposen
- Flow Sensor
- Myk start: Myk start
