  <Description><![CDATA[Varmt vann rengjøringsmidler Flow-aktivert i Performance

Når strømningen er kontrollert vannbevegelse gjennom en strømningssensor sender start-/stopimpulser til motoren og kjeler. Systemet gjør markedene mer brukervennlig, og gir både lang levetid, god pålitelighet og reduserer drifts-og vedlikeholdskostnader.

Rengjøring Rengjør prisbelønte designen gjør det både lett å bruke og lett å vedlikeholde.

EcoPower kjele systemet sikrer økt effektivitet av> 92% på grunn av en betydelig reduksjon i drivstofforbruk, svært lave driftskostnader og redusert luftforurensning. Sjanse for konstant temp. ved 80 ° C ved full flyt / press, elektronisk overvåking av drivstofforbruk og pumpe olje, dampnivå for spesialiserte oppgaver, og effektiv motorkjøling, er bare noen av de mange egenskapene.

- EcoPower kjele
- 1450 RPM motor med aksial pumpe for lavt støynivå
- Keramiske stempler og messing sylindertopp gir lengre liv
- Flow styrt kontroll
- Ikke noe press i høytrykksslange i standby situasjon øker komforten og sikkerheten til bruk
- Rask service
