 Alle støvsugere utvise utblåsningsluften føres gjennom et filter før det går tilbake inn i rommet som ren luft. Men filtre er ikke bare filtre, og enkelte partikler som er så små at de går helt gjennom et mindre effektivt filter og tilbake til rommet. Vi merker det kanskje ikke - noen mennesker er mindre følsomme enn andre , men støvet er der, og det er absolutt ikke sunt . Når du ser på genene det kan gi, som for eksempel astma, allergi og bronkitt , som er økende helseproblemer, er det fornuftig å velge HEPA filter. Nilfisk velge dem .

 HEPA står for High Efficiency partikler Air. Det er et anerkjent filtersystem som har fem filtrerings klasser av HEPA 10-14 § § 13 og 14 er i stand til å fange opp mikroskopiske partikler fra tobakksrøyk og husstøvmideafføring - som er triggere for støv allergi - og filtre sender renset luften tilbake i rommet enda renere enn før.

Et HEPA filter bør skiftes ca. en gang i året.]]></Description>
</product><product>
