  <ImageURL>http://www.kashop.no/files/images/Camilla/Hoejtryksrensere/Benzin/2-31_pe_xt.jpg</ImageURL>
  <Description><![CDATA[Bensindrevne kaldt vann renere for tunge rengjøringsjobber

POSEIDON PE serien er perfekt for områder der strøm ikke er tilgjengelig eller tilstrekkelig. Har Suge og kan suge vann fra en vanntank, dam eller innsjø - eller andre naturlige kilde. Spesielt egnet for byggherrer, entreprenører, landbruk og utleiefirmaer.

Alle pumper er designet for å håndtere selv de tøffeste oppgavene og er raske og enkle å vedlikeholde og service. De profesjonelle modellene har olje-term glass og olje.

- Robust design
