  <Description><![CDATA[Rondel, Diamant 13" 330mm 2 stk 

Flere farve - se variant 

DIAMANTER GØR GULVENE RENE OG SKINNENDE
At anvende diamantrondeller er tidsbesparende, miljøvenligt og
giver et bedre resultat. Metoden er udviklet til bløde stengulve,
men giver også et flot resultat på andre gulvtyper, såsom plast
og linoleum samt polishbelagte overflader.

Metoden er især velegnet til butikker, indgangspartier og på andre
hårdt trafikerede overflader, hvor der stilles ekstra høje krav til at
gulvet ikke bare skal være rent, men også blankt og indbydende.

MILJØ OG RESULTAT
Med dette rengøringssystem foretages al daglig rengøring uden
kemi. Kombinationen af diamantrondeller og rent vand giver et
perfekt rengøringsresultat, og minimerer tilsmudsning.

I ekstra tilsmudsede områder eller omkring produktionsudstyr,
kan rengøringsmiddel tilføjes. 
· Renoverer gamle, slidte gulve og genskaber glansen.
· Rengør med eller uden rengøringsmiddel efter behov.
· Polerer gulvet til den ønskede glans.

STEP 1 - RØD DIAMANT
Denne rondel nulstiller gamle, slidte gulve og
giver en mat overflade.

STEP 2 - BLÅ DIAMANT
Denne rondel fjerner ridser, revner og ujævnheder
og giver en mat overflade.

STEP 3 - GUL DIAMANT
En rondel til daglig rengøring der fjerner smuds
og pletter, og giver en halvblank overflade der er
nem at holde ren.

STEP 4 - GRØN DIAMANT
En rondel til daglig rengøring der fjerner smuds
og pletter og giver en blank overflade. Til
højglanspolering - tørpoler med en high-speed
maskine der passer til underlaget.]]></Description>
</product><product>
