  <Description><![CDATA[Rask og enkel polering

Nilfisk BU500 er en hendig og lett å bruke gulvpoleringsmaskin 1500 rpm med innebygd pad driver. Det lave støynivået gjør BU500 ideell til rengjøring på dagtid uten å forstyrre omgivelsene.

Den sammenleggbare håndtaket gjør det enkelt og praktisk å lagre og transportere BU500 - og gjøre maskinen klar til bruk i løpet av sekunder.
BU500 er egnet for høyglanspolering av plast og steingulv som marmor og TERRASSO. 15 meter kabel på en dreibar ledning krok gjør det enkelt å komme i gang raskt på et stort område. Den høydejusterbare håndtaket i riktig vinkel, noe som gjør BU500 svært hyggelig å jobbe med.
Et moderne design i rene linjer presenterer en produktiv poleringsmaskin.


