  <Description><![CDATA[Minimalt lydniveau og maksimal sugestyrke

GD 2000 serien er en effektiv professionel støvsuger med et ekstremt lavt lydniveau (44 dB*), et kraftigt sug og fantastisk filtrering. 

*Ifølge BS 5415 ved lav hastighed.

Vores GD 2000 støvsuger serie kan udstyres med flere forskellige filtre, bl.a. HEPA 13 filter før (kommer primo/medio 2004) og efter motoren. En anden unik ting er motorkassetten, som nemt kan udskiftes ved at løsne 4 skruer, hive kassetten op og isætte en ny motorkassette (ingen ledninger).

