  <Description><![CDATA[Fleksibel og kompakt med flere funksjoner - Fylle røret er inkludert v.køb!

Nilfisk SC400 gir deg rensekapasitet og fleksibilitet som en stor skrubber, men bygget inn i en hendig liten maskin som er enkel å bruke og effektiv å bruke.

Maskinen er ideell for daglig vask og tørking for lett til middels oppgaver som skoler, institusjoner, hoteller, små supermarkeder og butikker.

Den innovative håndtaket er utstyrt med en hendig LED display som viser batteri-og vann-nivået. Elektronisk vannkontroll, sikkerhetsbryter og av / på vippearmer gir deg full kontroll.

SC400 tilbyr god manøvreringsevne og gjør det lettere å rengjøre nær vegger og andre hindringer. Løftesystem til nal er en smart fotbetjente løftesystem i stedet for den tradisjonelle kabel, som gjør det daglige arbeidet mer behagelig og effektiv.

