SCRUBTEC 343,2 er oppfølgeren til den svært populære SCRUBTEC 343, med den nyeste teknologien når det kommer til nal suspensjon, vannforsyning, sikkerhet og ytelse. En pålitelig og produktiv maskin med god ytelse, høy pålitelighet og lav pris, ideell for lette og middels kraftig rengjøring av gulv.

SCRUBTEC 343,2 forbedret komfort takket være den nye fot-opererte løftesystemet for nalen. Rene gulv og høy produktivitet takket være et høyt børstetrykk og god suge. Utenfor dekk systemkontroll sikrer optimal trekkraft på alle gulv. Ny og forbedret polypropylen dekk system er mer støtsikker og senker kostnadene for tjenesten. Den nydesignede børste og sugemotordekselet beskytter de elektriske delene, noe som gir høyere sikkerhet og pålitelighet

Typiske bruksområder er varehus, kjøpesentre, varehus, sykehus, supermarkeder, bilforretninger, skoler, restauranter og kantiner, offentlige etater, næringsmiddelindustrien, industri, osv.

