  <Description><![CDATA[Alto MAXXI II 75 - 2WD - DUAL MOTOR

NYHETER FRA NILFISK ALTO!
Kraftig og enkel å bruke våd-/tørsuger med stor tankkapasitet
Den MAXXI II 75 er det mulig å støvsuge både vått og tørt - uten å måtte bytte filter. Tankkapasiteten er 75 liter. MultiFit tillater bruk av et bredt spekter av tilbehør. Utskifting av filter er rask og enkel, ettersom det ikke er nødvendig å fjerne motorens topp før.

Våd-/tørsugeren MAXXI II 75 er utstyrt med et bredt spekter av innovative funksjoner som gjør den daglige bruken og vedlikeholdet enkelt, ergonomisk og mer produktiv. En skråstilling av motor toppen gjør det lettere og sikrere å betjene støvsugeren - slik som tømming av beholderen. Beholderen kan tømmes enten ved tipping av beholderen eller ved hjelp av tømmeslangen - uten å fjerne motor toppen. Den suspenderte motor toppen lar deg endre filteret raskt uten at motoren topp å bli løftet på . Når containeren er løftet, er det anbefalt å heve denne med en hånd og holde tilbake på den annen side den drivende spaken.

MAXXI II 75 er utstyrt med separat tralle. MAXXI II 75 er egnet for krevende applikasjoner i tøffe og våte miljøer som byggeplasser og i industrien - for rengjøring etter rørlegger eller elektrisk arbeid.

