  <Description><![CDATA[Nyhet! Ny og forbedret SC351 erstatte SC350

Den neste generasjonen av daglig renhold mindre områder

SC351 tilbyr gulv vasking og tørking i alle retninger, med en imponerende børstetrykk på 27 kg. Det er lett å se hvor nyttig denne funksjonen er i forhold til å rydde i trange rom mellom og bak bordene, hyller, møbler og andre vanskelig tilgjengelige områder.

Nilfisk SC351 representerer neste generasjon av rengjøringsmaskiner, og bygger på over 100 år med Nilfisk tradisjon, som er preget av pålitelige rengjøringsutstyr av høy kvalitet.

Maskinen er perfekt for rengjøring av hoteller, skoler og institusjoner, små butikker, kantiner og kafeer.

Slipp kosthold, skrubbing maskiner og store, dyre maskiner som oppnår heller fantastiske resultater med Nilfisk SC351 :

Funksjoner:


OPTIMA BATTERI
MED INNEBYGD LADER
AUTOMATISK BØRSTE STOP
AUTO STOPP FOR VANN
JUSTERBART HÅNDTAK
AVTAGBAR LOKK T / DIRT VANN TANK
BATTERIINDIKATOR
VANSKELIG Å LØSE HJUL
STØTFANGERE PÅ NAL
ROTERENDE TRACTION


-Den roterende dekk gjør denne kompakte maskinen er i stand til å vaske og tørke i alle retninger
-27 kg børstetrykk for utmerket vaskeresultat
-Kraftig børstemotor øker påliteligheten og reduserer
servicekostnader
-Den redesignede dekksystem sikrer pålitelig og høy ytelse , lavere vedlikeholdskostnader
-Optima batteri sikrer høy produktivitet og konsistent ytelse
-Enkelt justere pensel dekk for perfekt fremdriftskontroll
-Ny nal system med høy absorpsjon kapasitet og patentert feste av nalen , noe som gjør det enkelt å fjerne og erstatte suge gummi
 
tekniske spesifikasjoner
- Vekt med/uten batterier ( KG ) 73/42
- Mål L x B x H ( mm ) 730 x 435 x 470
- Vann ren/- innsamling tank ( L ) 11/11
- Kapasitet teoretisk / praktisk ( m2/hour ) 1480/890
- Maksimal kjøretid pr.opladning ( T ) 1,15
- Brush Bredde ( mm ) 370]]></Description>
