  <Description><![CDATA[Nilfisk Eco Brilliance rondeller sparer tid, er miljøvenlige og sikrer det perfekte rengøringsresultat. 

Rondellerne er udviklet til sten- og betongulve, men er også ideelle til andre gulvtyper, som vinyl, linoleum og polerede gulve. 

Til almindelig dagligdags rengøring kræves der ingen brug af rengøringsmidler. Kombinationen af ECO Brilliance og rent vand giver det perfekte resultat. I meget snavsede områder kan rengøringsmidler dog være nødvendige.


TRIN 1 ? RØD
Fjerner gammel, slidt belægning ? efterlader gulvet mat.

TRIN 2 ? BLÅ
Fjerner større ridser, revner og ujævnheder ? efterlader gulvet mat.

TRIN 3 ? GUL
Til daglig rengøring. Fjerner snavs og ridser ?efterlader gulvet blankt og rengøringsvenligt.

TRIN 4 ? GRØN
Til daglig rengøring. Fjerner snavs og ridser ? efterlader gulvet meget glansfuldt. 
Kan på egnede gulve anvendes sammen med en højhastighedsmaskine,
så gulvet bliver højglanspoleret.]]></Description>
</product><product>
