Leter du etter en kvalitet støvsuger, Nilfisk Elite Comfort være svaret. Det er høydepunktet for Nilfisk og inkluderer en god filtrering med brukervennlige funksjoner og et ergonomisk håndtak med fjernkontroll.

<b>Nilfisk Elite Comfort specifikationer</b>
- 2000 W motoreffekt
- 450 watt sugeeffekt ved enden av røret
- Ultra Plus Filtration System
- HEPA H14 / HEPA forseglet kabinett
- 3 kvalitet tilbehør bygget
- Teleskop aluminium
- Visning av bærehåndtaket
- Vekt kun 7,2 kg
- Range 13,2 m
- Stop & Go -funksjon
- Håndtak ON / OFF AUTO MODE

En voksende trend er at flere og flere mennesker lider av ulike former for allergier. For å sikre optimal rengjøring , er det nødvendig å øke vekt på de meget små partikler. Nilfisk Elite sørger vi for oppsamling av støv, gir effektiv filtrering og retensjon av små partikler før vi blåse rene renset luft inn i rommet på nytt. Hos oss vil vi sørge for at dine rengjøringsbehov er oppfylt. Vi konsentrerer oss om å lage gode støvsugere.

Enten du nettopp flyttet hjemmefra, har en stor familie med barn, unge eller gamle, Nilfisk den perfekte løsningen for deg .

Her er noen ting du bør vite når du kjøper en ny støvsuger med HEPA filter:
- HEPA filter bør plasseres etter at motoren for å sikre at utblåsningsluften er renset før det sendes ut i verdensrommet igjen.
- HEPA- filterenhet og vakuum kapslingen må være fullstendig lufttett , slik at den forurensede luft blåses ikke utilsiktet ut i rommet. Nilfisk kaller dette en HEPA tett konstruksjon.
En støvsuger med en god HEPA filter og et HEPA forseglet kabinett, er litt dyrere enn vanlige støvsugere, men er en god investering for alle.
Nilfisk Elite støvsugere er designet for å være holdbar og samtidig gjør rengjøringen enkel og ergonomisk effektiv.

- Sterk støv absorpsjon: En sterk motor og en godt utformet dyse sikrer best støvoppsamling
- Allergi filtrering: Microfiber støvpose, lufttett konstruksjon og HEPA H14-filter. Din beste beskyttelse mot allergener fra dyrehår, støvmidd og deres ekskrementer
- Brukervennlig bag suspensjon sikrer rask og ergonomiske bag endringer
- Sannsynligvis det beste filtrering i verden for husholdning støvsugere
- Håndtak med fjernkontroll på / av og justere nivået på suge direkte på håndtaket
- Stille. 71 dB (A) er svært lav for husholdning støvsugere
- 5 års garanti på Nilfisk elite komfort]]></Description>
